package Leetcode.editor.cn;

import java.util.ArrayDeque;
import java.util.Deque;

/**
 * 2022-10-26 09:05:59
 * [862] - 和至少为 K 的最短子数组
 * ShortestSubarrayWithSumAtLeastK.md
 */
public class ShortestSubarrayWithSumAtLeastK{
    public static void main(String[] args) {
        long start = System.currentTimeMillis();
        
        Solution solution = new ShortestSubarrayWithSumAtLeastK().new Solution();
        System.out.println("运行结果：" + solution.shortestSubarray(new int[]{1}, 1));
        System.out.println("运行结果：" + solution.shortestSubarray(new int[]{1,2}, 4));
        System.out.println("运行结果：" + solution.shortestSubarray(new int[]{2,-1,2}, 3));
        
        System.out.println("耗时：" + (System.currentTimeMillis() - start) + " ms");
    }
    
    //leetcode submit region begin(Prohibit modification and deletion)
    class Solution {
        public int shortestSubarray(int[] nums, int k) {
            int n = nums.length, ans = n + 1;
            //预处理，求一下前缀和，以便后续可以快速求出区间和，拿来做比较
            //切记要开 long 否则大数组 加出来的和会溢出，比如下方的案例
            //int[] preSum = new int[n + 1];
            long[] preSum = new long[n + 1];
            for(int i = 0; i < n; i++){
                preSum[i + 1] = preSum[i] + nums[i];            
            }
            
            // O(n^2) 优化至 O(n)
            //for(int i = 0; i < n; i++){
            //    for(int j = 0; j <= i; j++){
            //        if(preSum[i + 1] - preSum[j] >= k){
            //            ans = Math.min(ans, i - j + 1);
            //        }
            //    }
            //}

            Deque<Integer> q = new ArrayDeque<>();
            for(int i = 0; i <= n; i++){
                while(!q.isEmpty() && preSum[i] - preSum[q.peekFirst()] >= k){
                    ans = Math.min(ans, i - q.pollFirst()); //优化一                    
                }
                while(!q.isEmpty() && preSum[q.peekLast()] >= preSum[i]){
                    q.pollLast();   //优化二
                }
                q.offerLast(i);
            }

            return ans > n ? -1 : ans;
        }
    }
    //leetcode submit region end(Prohibit modification and deletion)

}


